import "./Board.css";
import BackgroundCellGenerator from "./Board/BackgroundCellGenerator";
import BlackChecker from "./Board/BlackChecker";
import WhiteChecker from "./Board/WhiteChecker";
import GameModelCheckerGenerator from "./Board/GameModelCheckerGenerator";

function Board({GameModel}) {
    return <div className="Board">
        <GameModelCheckerGenerator GameModel={GameModel} />
        <BackgroundCellGenerator/>
        <BlackChecker x={2} y={7}/>

        <WhiteChecker x={1} y={6}/>
        <WhiteChecker x={3} y={6}/>
        <WhiteChecker x={5} y={6}/>
        <WhiteChecker x={7} y={6}/>
        <WhiteChecker x={2} y={7}/>
        <WhiteChecker x={4} y={7}/>
        <WhiteChecker x={6} y={7}/>
        <WhiteChecker x={8} y={7}/>
        <WhiteChecker x={1} y={8}/>
        <WhiteChecker x={3} y={8}/>
        <WhiteChecker x={5} y={8}/>
        <WhiteChecker x={7} y={8}/>

        for(let x = 1; ){
         <WhiteChecker x = {x}></WhiteChecker>
        }

        <div style={{gridColumn: 4, gridRow: 4}}></div>
        <div style={{gridColumn: 2, gridRow: 2}}></div>
        <div style={{gridColumn: 6, gridRow: 6}}></div>

    </div>
}

export default Board;
